ossible in a few days or hours what used to take hundreds of workers weeks or months.\n\nThey operate Germany's largest and strongest machines. With courage and sure instinct, they control machines weighing tons with millimetre precision. What do the men have to bring along if they want to operate Germany's largest machines safely and how are such mega-aggregates manufactured? The German mechanical engineering industry is world-famous. Men \u0026 Machines shows why. Get a glimpse into the production halls of these machines and see engineering at its best.\n\n00:00 Mole of Steel\nWe visit the construction site of the Albvorlandtunnel between Stuttgart and Ulm in Germany, where two huge tunnel drilling machines are used.\n\n00:46:08 Mobile Monster Cranes\nWithout the one-armed giants, nothing works on major construction sites. We take a look at cranes. With a 100 metre long telescopic boom and a maximum load capacity of 1200 tonnes, the nine-axle LTM 11200-9.1 is particularly suitable for the construction of wind turbines.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #megamachines \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/VcU0umWyfvk/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLB_xVnZoX4ldRdtgNEM21a2EAGWYw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/VcU0umWyfvk/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLBP ]},"embed":{"iframeUrl":"https://www.youtube.com/embed/VcU0umWyfvk","width":1280,"height":720},"title":{"simpleText":"Mega Machines: Taming Mechanical Giants | FD Engineering"},"description":{"simpleText":"Mega Machines: Taming Mechanical Giants | FD Engineering\n\nWatch 'Mega Factories: Manpower Meets High-Tech' here: https://youtu.be/DVpfAN6l5Nk\nWatch 'Extreme Constructions - Complete Series' here: https://youtu.be/XKndrP5zT-c\n\nHuge tools make possible in a few days or hours what used to take hundreds of workers weeks or months.\n\nThey operate Germany's largest and strongest machines. With courage and sure instinct, they control machines weighing tons with millimetre precision. What do the men have to bring along if they want to operate Germany's largest machines safely and how are such mega-aggregates manufactured? The German mechanical engineering industry is world-famous. Men \u0026 Machines shows why. Get a glimpse into the production halls of these machines and see engineering at its best.\n\n00:00 Mole of Steel\nWe visit the construction site of the Albvorlandtunnel between Stuttgart and Ulm in Germany, where two huge tunnel drilling machines are used.\n\n00:46:08 Mobile Monster Cranes\nWithout the one-armed giants, nothing works on major construction sites. We take a look at cranes. With a 100 metre long telescopic boom and a maximum load capacity of 1200 tonnes, the nine-axle LTM 11200-9.1 is particularly suitable for the construction of wind turbines.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #megamachines \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documenta ollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CNoDEM2rARgBIhMIkNWMsKrugAMVpi0GAB0PzQW-","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Mega Machines: Taming Mechanical Giants | FD Engineering\n\nWatch 'Mega Factories: Manpower Meets High-Tech' here:    • Mega Factories: Manpower Meets High-T...  \nWatch 'Extreme Constructions - Complete Series' here:    • Extreme Constructions | Complete Seri...  \n\nHuge tools make possible in a few days or hours what used to take hundreds of workers weeks or months.\n\nThey operate Germany's largest and strongest machines. With courage and sure instinct, they control machines weighing tons with millimetre precision. What do the men have to bring along if they want to operate Germany's largest machines safely and how are such mega-aggregates manufactured? The German mechanical engineering industry is world-famous. Men \u0026 Machines shows why. Get a glimpse into the production halls of these machines and see engineering at its best.\n\n00:00 Mole of Steel\nWe visit the construction site of the Albvorlandtunnel between Stuttgart and Ulm in Germany, where two huge tunnel drilling machines are used.\n\n00:46:08 Mobile Monster Cranes\nWithout the one-armed giants, nothing works on major construction sites. We take a look at cranes. With a 100 metre long telescopic boom and a maximum load capacity of 1200 tonnes, the nine-axle LTM 11200-9.1 is particularly suitable for the construction of wind turbines.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #megamachines \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science le":{"runs":[{"text":"Mega Machines: Taming Mechanical Giants | FD Engineering"}]},"channel":{"simpleText":"Free Documentary - Engineering"},"views":{"simpleText":"104,289 views"},"publishDate":{"simpleText":"Aug 6, 2023"},"factoid":[{"factoidRenderer":{"value":{"simpleText":"652"},"label":{"simpleText":"Likes"},"accessibilityText":"652 likes"}},{"factoidRenderer":{"value":{"simpleText":"104,289"},"label":{"simpleText":"Views"},"accessibilityText":"104,289 views"}},{"factoidRenderer":{"value":{"simpleText":"Aug 6"},"label":{"simpleText":"2023"},"accessibilityText":"Aug 6, 2023"}}],"channelNavigationEndpoint":{"clickTrackingParams":"CCsQ040EGAciEwiQ1Yywqu6AAxWmLQYAHQ_NBb4=","commandMetadata":{"webCommandMetadata":{"url":"/@FD_Engineering","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCKFjNynYRgDfnSIXzELPqTA","canonicalBaseUrl":"/@FD_Engineering"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/gmUlT_9Myq4ZbzpLPDnZjT8K4FX1bbImM6KY0xbk8eGnGfh6u6AfkqiVAJC1N_2LnvYaYwv8=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Mega Machines: Taming Mechanical Giants | FD Engineering\n\nWatch 'Mega Factories: Manpower Meets High-Tech' here:    • Mega Factories: Manpower Meets High-T...  \nWatch 'Extreme Constructions - Complete Series' here:    • Extreme Constructions | Complete Seri...  \n\nHuge tools make possible in a few days or hours what used to take hundreds of workers weeks or months.\n\nThey operate Germany's largest and strongest machines. With courage and sure instinct, they control machines weighing tons with millimetre precision. What do the men have to bring along if they want to operate Germany's largest machines safely and how are such mega-aggregates manufactured? The German mechanical engineering industry is world-famous. Men \u0026 Machines shows why. Get a glimpse into the production halls of these machines and see engineering at its best.\n\n00:00 Mole of Steel\nWe visit the construction site of the Albvorlandtunnel between Stuttgart and Ulm in Germany, where two huge tunnel drilling machines are used.\n\n00:46:08 Mobile Monster Cranes\nWithout the one-armed giants, nothing works on major construction sites. We take a look at cranes. With a 100 metre long telescopic boom and a maximum load capacity of 1200 tonnes, the nine-axle LTM 11200-9.1 is particularly suitable for the construction of wind turbines.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #megamachines \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering.","commandRuns":[{"startIndex":113,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ040EGAciEwiQ1Yywqu6AAxWmLQYAHQ_NBb4=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=DVpfAN6l5Nk\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"DVpfAN6l5Nk","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr5---sn-n545gpjvh-hc5e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026beids=24350017\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=0d5a5f00dea5e4d9\u0026ip=105.160.120.134\u0026initcwndbps=236250\u0026mt=1692640396\u0026ow
